import React from 'react'

export const CreateNote = () => {
    return (
        <>
            <div className="main_contant">
                <input type="text" 
                 placeholder="Title"
                />
                <textarea name=""  cols="" rows=""
                ></textarea>
            </div>
        </>
    )
}
export default CreateNote;
